package day18;

public class C04_DoWhileLoop {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		for (char i = 'm'; i >'c'; i--) {
		System.out.print(i +" ");	
		}
		System.out.println("");
		char krk='m';
		while (krk>'c') {
			System.out.print(krk +" ");
			krk--;
		}
		
		
		
	

	}

}
